def read_barcode_from_com(port='/dev/ttyACM0', baudrate=9600, timeout=1):
    try:
        with serial.Serial(port, baudrate, timeout=timeout) as ser:
            print(f"Verbunden mit {port}. Warte auf Barcode-Scan...", flush=True)
            while True:
                if ser.in_waiting > 0:
                    barcode = ser.readline().decode('utf-8').strip()
                    if barcode in barcode_aktionen:
                        print(f"Gltiger Barcode erkannt: {barcode}", flush=True)
                        barcode_aktionen[barcode]()  # Entsprechende Funktion aufrufen
                        global zpl
                        s = socket.socket(socket.AF_INET, socket.SOCK_STREAM)
                        s.connect((TCP_IP, TCP_PORT))
                        s.send(bytes(zpl, "utf-8"))
                        zpl = ""
                        s.close()
                    else:
                        print(f"Ungltiger oder nicht zugeordneter Barcode: {barcode}", flush=True)
                        with open("missingBarcodes.txt", "a") as f:
                            f.write(barcode + '\n')
                            print("in toto-Liste aufgenommen", flush=True)
                    time.sleep(1)

    except serial.SerialException as e:
        print(f"Fehler beim Zugriff auf {port}: {e}", flush=True)
    except KeyboardInterrupt:
        print("\nBeendet durch Benutzer.", flush=True)

    
        
